import React from 'react';
import './PatientResources.css';
import resourceImage1 from '../assets'; 
import resourceImage2 from '../assets/resources2'; 
import resourceImage3 from '../assets/resource3.jpg'; 

const PatientResources = () => {
  return (
    <section id="patient-resources" className="patient-resources">
      <h2>My Work</h2>
      <div className="resources-container">
        <div className="resource-card">
          <img src={resourceImage1} alt="Resource 1" className="resource-image"/>
          <div className="resource-text">
            <h3>Social Media App</h3>
            <p>The app connects you to the talented people around the world. Download it from the play store.</p>
            <a href="#learn-more">Learn more</a>
          </div>
        </div>
        <div className="resource-card">
          <img src={resourceImage2} alt="Resource 2" className="resource-image"/>
          <div className="resource-text">
            <h3>Health Tracking App</h3>
            <p>Track your health and fitness activities seamlessly with our advanced tracking app.</p>
            <a href="#learn-more">Learn more</a>
          </div>
        </div>
        <div className="resource-card">
          <img src={resourceImage3} alt="Resource 3" className="resource-image"/>
          <div className="resource-text">
            <h3>Medication Reminder</h3>
            <p>Never miss your medication with our easy-to-use reminder app. Download it today.</p>
            <a href="#learn-more">Learn more</a>
          </div>
        </div>
      </div>
    </section>
  );
};

export default PatientResources;
